// Base64 encoded svgs to use as icons for various MIME types
package main

import (
	"io"
	"log"
	"mime"
	"net/http"
	"os"
	"path/filepath"
	"strings"
)

// getIcon returns the base64 encoded icon associated with the MIME type of the given file.
// name is absolute path to file.
func getIcon(name string) string {
	mtype := mime.TypeByExtension(filepath.Ext(name))

	// Sniff first 512 bytes of the file and check.
	if mtype == "" {
		buf := make([]byte, 512)

		f, err := os.Open(name)
		if err != nil {
			log.Printf("Error opening file %s : %v\n", name, err)
			return iconCache["unknown"]
		}
		defer f.Close()

		n, err := f.Read(buf)
		if err != nil && err != io.EOF {
			log.Printf("Error opening file %s : %v\n", name, err)
			return iconCache["unknown"]
		}

		f.Seek(0, 0)

		mtype = http.DetectContentType(buf[:n])
	}

	// Detected mime type can be like -
	// text/x-sh; charset=utf-8
	// Strip the charset
	w := strings.Split(mtype, "; ")[0]
	iconName := strings.Replace(w, "/", "-", -1)

	_, found := iconCache[iconName]
	if !found {
		iconName = strings.Split(iconName, "-")[0] + "-x-generic"
	}

	// Try to get a more specific icon.
	if iconName == "text-plain" || iconName == "text-x-generic" {
		iconName = textFileIcon(name)
	}

	icon, found := iconCache[iconName]
	if !found {
		return iconCache["unknown"]
	}
	return icon
}

// textFileIcon tries to find a more specific icon based on the filename
// and the extension for text files.
func textFileIcon(name string) string {
	iconName := ""
	// Check first for whole filenames like -
	// CMakeLists.txt, AUTHORS, COPYING  etc.
	// then the extension

	switch filepath.Base(name) {
	case "CMakeLists.txt":
		iconName = "text-x-cmake"
	case "COPYING":
		iconName = "text-x-copying"
	case "AUTHORS":
		iconName = "text-x-credits"
	case "Makefile":
		iconName = "text-x-cmake"
	case "meson.build":
		iconName = "text-x-meson"
		//case "LICENSE":
		//	iconName = ""
	}

	if iconName != "" {
		return iconName
	}

	switch filepath.Ext(name) {
	case ".vala":
		iconName = "text-x-vala"
	case ".java":
		iconName = "text-x-java"
	case ".cmake":
		iconName = "text-x-makefile"
	case ".changelog":
		iconName = "text-x-changelog"
	case ".c":
		iconName = "text-x-csrc"
	case ".h":
		iconName = "text-x-chdr"
	case ".cxx":
		iconName = "text-x-c++src"
	case ".css":
		iconName = "text-css"
	case ".md":
		iconName = "text-markdown"
	case ".markdown":
		iconName = "text-markdown"
	case ".readme":
		iconName = "text-x-readme"
	case ".meson":
		iconName = "text-x-meson"
	case ".template":
		iconName = "text-x-generic-template"
	case ".py":
		iconName = "text-x-python"
	case ".sql":
		iconName = "text-x-sql"
	case ".ssa":
		iconName = "text-x-ssa"
	case ".script":
		iconName = "text-x-script"
	case ".patch":
		iconName = "text-x-patch"
	case ".json":
		iconName = "text-x-script"
	}

	if iconName != "" {
		return iconName
	}

	return "text-x-generic"
}

